import axios from "axios";
import { createContext } from "react";
import { getCookie } from "./helpers/auth";
const id = getCookie().token


let value = async () => {
    axios.post("http://localhost:2704/api/msgC/contactL?start=" + 0 + "&end=" + 10, { id })
        .then(res => {
            if (!res.data.message) {
                return res.data
            }
        }).catch(err => {
        })
}
export const Notifications = createContext([]);
let fnc = async () => {
    let data = await value()
    const MessageList = createContext(data);
    return MessageList
}
export const MessageList = fnc()
